import React from 'react'
import ReactDOM from 'react-dom'
import Card from './Card'
import Sdata from './Sdata'

ReactDOM.render(
  <>
    <h1>List of Top 5 Netflix Series</h1>
    {Sdata.map((val) => {
      return (
        <Card
          key={val.id} // Jab bhi aap map method ka use kare tab ye key props (property) hona he chaiye. Aapko yaha 'key' he likna hai aap keys bhi nahi lik sakte.
          imgsrc={val.imgsrc}
          title={val.title}
          sname={val.sname}
          link={val.link}
        />
      )
    })}
  </>,
  document.getElementById('root')
)
